import React from 'react';
import { Link } from 'react-router-dom';
import './homepage.css';

const HomePage = () => {
  return (
    <div className="home-container">
      <div className="nav-bar">
        {/* Use Link instead of a tags */}
        <Link to="/dashboard" className="nav-link">Login</Link>
        <Link to="/grades" className="nav-link">Dashboard</Link>
        <Link to="/grade-reporting" className="nav-link">Grade Reporting</Link>
        <Link to="/missing-grades" className="nav-link">Missing Grades</Link>
        <Link to="/instructor-contact" className="nav-link">Instructor Contact</Link>
        <Link to="/LoginPage" className="nav-link">Help</Link>
        {/* Add more links as needed */}
      </div>
      <div className="content">
        {/* ... (rest of your component remains unchanged) */}
      </div>
      <div className="footer">
        {/* ... (rest of your component remains unchanged) */}
      </div>
    </div>
  );
};

export default HomePage;
